import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')

);
function myFunction() {
  document.getElementById("awesome").innerHTML = "Paragraph changed.";
}

